// src/pages/SelectMood.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const SelectMood = () => {
  const navigate = useNavigate();
  const [selectedMood, setSelectedMood] = useState(null);

  const moods = [
    { id: 1, emoji: 'ðŸ˜Š', name: 'Happy', color: '#F9D71C' },
    { id: 2, emoji: 'ðŸ˜¢', name: 'Sad', color: '#5D8BF4' },
    { id: 3, emoji: 'ðŸ˜¡', name: 'Angry', color: '#FF6B6B' },
    { id: 4, emoji: 'ðŸ˜Œ', name: 'Calm', color: '#6BCB77' },
    { id: 5, emoji: 'ðŸ˜´', name: 'Tired', color: '#A685E2' },
    { id: 6, emoji: 'ðŸ¤ª', name: 'Energetic', color: '#FF9F45' }
  ];

  const handleMoodSelect = (mood) => {
    setSelectedMood(mood);
    // You can save the mood selection to state/backend here
    setTimeout(() => navigate('/dashboard'), 1500); // Navigate after selection
  };

  return (
    <div style={styles.pageContainer}>
      <div style={styles.backgroundImage}></div>
      <div style={styles.backgroundOverlay}></div>
      
      <div style={styles.contentContainer}>
        <div style={styles.card}>
          <div style={styles.header}>
            <h2 style={styles.title}>How are you feeling today?</h2>
            <p style={styles.subtitle}>Select your current mood</p>
          </div>
          
          <div style={styles.moodsContainer}>
            {moods.map(mood => (
              <button
                key={mood.id}
                style={{
                  ...styles.moodButton,
                  backgroundColor: selectedMood?.id === mood.id ? mood.color : 'rgba(255, 255, 255, 0.1)',
                  transform: selectedMood?.id === mood.id ? 'scale(1.1)' : 'scale(1)'
                }}
                onClick={() => handleMoodSelect(mood)}
              >
                <span style={styles.moodEmoji}>{mood.emoji}</span>
                <span style={styles.moodName}>{mood.name}</span>
              </button>
            ))}
          </div>
          
          {selectedMood && (
            <div style={styles.selectedMood}>
              <p>Selected: {selectedMood.emoji} {selectedMood.name}</p>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

const styles = {
  pageContainer: {
    position: 'fixed',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    overflow: 'auto',
  },
  backgroundImage: {
    position: 'fixed',
    top: 0,
    left: 0,
    width: '100vw',
    height: '100vh',
    backgroundImage: 'url(https://5minuteenglish.com/wp-content/uploads/2024/03/Exploring-English-Through-Different-Genres-of-Music-2-1.webp)',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    backgroundRepeat: 'no-repeat',
    zIndex: -2,
  },
  backgroundOverlay: {
    position: 'fixed',
    top: 0,
    left: 0,
    width: '100vw',
    height: '100vh',
    backgroundColor: 'rgba(0, 0, 0, 0.7)',
    zIndex: -1,
  },
  contentContainer: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    minHeight: '100vh',
    width: '100vw',
    padding: '20px',
    boxSizing: 'border-box',
  },
  card: {
    backgroundColor: 'rgba(20, 20, 30, 0.9)',
    backdropFilter: 'blur(8px)',
    borderRadius: '12px',
    boxShadow: '0 10px 30px rgba(0, 0, 0, 0.5)',
    width: '100%',
    maxWidth: '600px',
    padding: '40px',
    textAlign: 'center',
    border: '1px solid rgba(255, 255, 255, 0.1)',
  },
  header: {
    marginBottom: '30px',
  },
  title: {
    color: '#fff',
    fontSize: '28px',
    fontWeight: '600',
    marginBottom: '8px',
  },
  subtitle: {
    color: 'rgba(255, 255, 255, 0.7)',
    fontSize: '16px',
    marginBottom: '30px',
  },
  moodsContainer: {
    display: 'grid',
    gridTemplateColumns: 'repeat(3, 1fr)',
    gap: '15px',
    marginBottom: '30px',
  },
  moodButton: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '20px 10px',
    borderRadius: '10px',
    border: 'none',
    cursor: 'pointer',
    transition: 'all 0.3s ease',
    ':hover': {
      transform: 'scale(1.05)',
      boxShadow: '0 5px 15px rgba(0, 0, 0, 0.2)',
    }
  },
  moodEmoji: {
    fontSize: '36px',
    marginBottom: '8px',
  },
  moodName: {
    color: '#fff',
    fontSize: '14px',
    fontWeight: '500',
  },
  selectedMood: {
    marginTop: '20px',
    padding: '15px',
    backgroundColor: 'rgba(255, 255, 255, 0.1)',
    borderRadius: '8px',
    color: '#fff',
  }
};

export default SelectMood;
